from src.core.AbstractUnitOfWork import AbstractUnitOfWorkfrom src.statistics.repository.StatisticsRepository import StatisticsRepositoryclass UnitOfWork(AbstractUnitOfWork):    def __init__(self, session_factory):        self.session_factory = session_factory    def __enter__(self):        self.session = self.session_factory()  # typ: Session        self.statistics = StatisticsRepository(self.session)        return super().__enter__()    def __exit__(self, *args):        super().__exit__(*args)        self.session.close()    def _commit(self):        self.session.commit()    def rollback(self):        self.session.rollback()